// PredictedResults.js

import React from 'react';

const PredictedResults = ({ predictedData, onReset }) => {
  const { predicted_disease, dis_des, my_precautions, my_diet, workout } = predictedData;

  return (
    <div>
      <h2>Predicted Disease: {predicted_disease}</h2>
      <p>Description: {dis_des}</p>
      <h3>Precautions:</h3>
      <ul>
        {my_precautions.map((precaution, index) => (
          <li key={index}>{precaution}</li>
        ))}
      </ul>
      <p>Recommended Diet: {my_diet}</p>
      <p>Workout: {workout}</p>
      <button onClick={onReset}>Reset</button>
    </div>
  );
};

export default PredictedResults;
